for processes to communicate by exchanging structured messages. When a message is retrieved from the queue, the process receives exactly one message in its entirety; there is no way to retrieve part of a message and leave the rest in the queue. message queues are special identifiers and not file descriptors. message queues do not require or guarantee a first-in, first-out ordering . depends on priority. Message queues have kernel-level persistence and use special functions or utilities for removing them. Killing the process will not remove the message queue. POSIX message queue is only removed once it is closed by all processes currently using it. message queues has asynchronous notification feature means reader do not wait for message can add attributes to queue like message size or capacity of queue. Steps // Open (and possibly create) a POSIX message queue.
